    - "ЭКСКЛЮЗИВНОЕ ПРЕДЛОЖЕНИЕ!!!\nШИКАРНЫЙ ЭЛИТНЫЙ жилой комплекс \"ПАРАДНЫЙ КВАРТАЛ\"\nНОВЫЙ
      ДОМ!!! ЕВРОРЕМОНТ!!! АВТОРСКИЙ ДИЗАЙН!!!\nОбщая площадь 112+ ТЕРРАСА 65 кв.м.\r\nкухня-гостиная
      61м, спальня 23м, спальня 13м\nНа данный момент в квартире проведен комплекс
      работ по перепланировке (согласно проекту архитектора), возведены новые перегородки,
      полы дополнительно шумоизолированы, проведен полный комплекс работ по электрике
      и канализации-водоснабжению, кондиционированию (сделан вывод в вентиляционную
      шахту).\r\n В спальнях полы покрыты пробочным покрытием, так же - часть стен
      спальных комнат, остальные стены готовы к финишной отделке (обои, штукатурка...)
      Заменены подоконники в 2-х спальнях, на каменные.\r\nСанузлы - материалы стены:
      плитка - Италия, мозаика Италия - натуральный камень, плитка на полах - итал.
      и испанская (гостевой с/у) керамическая. В обоих с/у установлены инсталляции
      Geberit для подвесных унитазов, в большом с/у вмонтирована система для встраиваемого
      душа, оборудованы герметичные трапы для слива.\r\nВ холле, части гостиной и
      на кухне полы из испанского керама-гранита, полы в гостиной из массива \"светлый
      дуб\".\r\n Во всей квартире установлена светодиодная подсветка (потолки, оконные
      проемы, дверные проемы на террасу).\r\nЗаложены видео и аудио кабели ( системы
      BOSE) для подключения аппаратуры.\r\n В квартире устанавливается кухня, производства
      Италии, стоимость 10 500 евро.\r\nВ качестве бонуса прилогаяем бытовую технику
      для кухни SMEG ( островная вытяжка, индукционная варочная панель, духовой встраиваемый
      шкаф с микроволновкой , встраиваемая кофеварка).\nБОНУС: ------ 2 МАШИНОМЕСТА
      В ПОДЗЕМНОМ ПАРКИНГЕ--------\nПОЛУЧЕНО СОГЛАСИЕ НА ОСТЕКЛЕНИЕ ТЕРРАСЫ. \r\n______________________________________
